import React from 'react';
import styles from '../Features/Features.module.css';

function Features() {
  return (
    <section className={styles.features}>
      <div className={styles.container}>
        <div className={styles.feat}>
          <i className={`fas fa-cog ${styles.icon}`}></i>
          <h3 className={styles.heading}>Feature One</h3>
          <p className={styles.description}>Explanation of the first feature goes here.</p>
        </div>
        <div className={styles.feat}>
          <i className={`fas fa-star ${styles.icon}`}></i>
          <h3 className={styles.heading}>Feature Two</h3>
          <p className={styles.description}>Explanation of the second feature goes here.</p>
        </div>
        <div className={styles.feat}>
          <i className={`fas fa-bolt ${styles.icon}`}></i>
          <h3 className={styles.heading}>Feature Three</h3>
          <p className={styles.description}>Explanation of the third feature goes here.</p>
        </div>
      </div>
    </section>
  );
}

export default Features;
